import React from 'react';
import AUD from './components/AUD'; // Importa el componente AUD
import USD from './components/USD';

function App() {
  return (
    <div className="min-h-screen bg-gray-200 flex justify-center items-center">
      <AUD />
      <USD />
    </div>
  );
}

export default App;
